function Categories(){
    const [categories,setCategories] = useState("")
    useEffect(  
    ()=>{fetch('https://fakestoreapi.com/products/categories')
            .then(res=>res.json())
            .then(json=>setCategories(json))}
    ,[])
    return(
        <div>
            categories.map(categories)
        </div>
)}

export default Categories
